import React from "react";

export default function TableOfPromises({ joinablePromises }) {
  return (
    <div>
      <p>Promises you can join</p>
      <table>
        <th>ID</th>
        <th>Asset A</th>
        <th>Amount A</th>
        <th>Asset B</th>
        <th>Amount B</th>
      </table>
    </div>
  );
}
